import Layout from '../src/components/Layout';
import { Cookies } from 'react-cookie';

//components

const cookies = new Cookies();

const dashboard = () => {
    return (
        <Layout>
            <div className='main'>

            </div>
            <style global jsx>{`
                html,
                body,
                body > div:first-child,
                div#__next,
                div#__next > div,
                div#__next > div > div {
                    height: 100%;
                }

                *{
                    box-sizing: border-box;
                }

                .main{
                    width: 100%;
                    height: 100%;
                    background: linear-gradient(180deg, #C2C0C0, white);
                }

                .cabecera{
                    width: 100%;
                    height: 5%;
                    justify-content: center;
                    align-items: center;
                    display: flex;
                    flex-direction: row;
                }     


                .cabecera .logo{
                    width: 10%;
                    height: 100%;
                    text-align: center;
                    background: white;
                    text-align: right;
                    justify-content: center;
                    align-items: center;
                    display: flex;

                }

                .cabecera .logo img{
                    width: 50%;
                    margin-right: 10px;
                    display: block;
                }

                .cabecera .logo button{    
                    width: 20%;
                    font-size: 20px;
                    color: gray;
                    display: block;
                    background: transparent;
                    border: none;
                }

                .cabecera .opciones{
                    width: 90%;  
                }
            `}</style>
        </Layout>
    );
}

export default dashboard;
